import React, { Component, Fragment } from "react";
import "../css/App.css";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      inputValue: "何元鹏",
      list: [],
    };
  }
  render() {
    return (
      <Fragment>
        <div>
          <p>
            <input
              value={this.state.inputValue}
              onChange={this.handelOnChange}
            ></input>
            <button>点赞</button>
          </p>
          <ul>
            <li>1</li>
            <li>2</li>
            <li>3</li>
            <li>4</li>
            <li>5</li>
          </ul>
        </div>
      </Fragment>
    );
  }
  handelOnChange(e) {
    console.log(e.target.value);
  }
}
export default App;
